window.bookSummaryJSON = "<p>From <i>NYT</i> best-selling author J. A. Huss comes the final sexy stand-alone in the Jordan's Game series.</p> <p>Can a threesome really work? Or does it always crash and burn at the end?</p> <p>They were never meant to be just two. It was always three. But seven years ago Jordan Wells broke the trust he’d built with Alexander and Augustine and everything changed.</p> <p>Everyone moved on and got over it. Put the past behind them where it belonged and started new lives.</p> <p>But now Alexander and Augustine are back - looking for a new game and the final third to complete their threesome. And they won’t take no for an answer.</p> <p>Jordan Wells is about to play his final game. Will he win? Or will he be too afraid to try?</p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
